angular.module('Cookies.controllers', [])

.config(function($compileProvider){
  $compileProvider.imgSrcSanitizationWhitelist(/^\s*(https?|ftp|mailto|file|tel):/);
})

.controller('HomeCtrl', function($scope, $rootScope, $state) {
  $scope.gotoPhoto = function() {
    $state.go('photo');
  }
})

.controller('PhotoCtrl', function($scope, $rootScope, $state, $http, Camera, env) {

  // initialize
  if($rootScope.lastPhoto != undefined) {
    $scope.photoTaken = true;
    $scope.lastPhoto = $rootScope.lastPhoto;

    $scope.cropLeft = 0;
    $scope.cropTop = 0;
    $scope.cropWidth = 80;
    $scope.cropHeight = 120;
  } else {
    $scope.photoTaken = false;
    $scope.lastPhoto = "";

    $scope.cropLeft = 0;
    $scope.cropTop = 0;
    $scope.cropWidth = 80;
    $scope.cropHeight = 120;
  }

  $scope.getPhoto = function() {
    console.log('Getting camera');
    Camera.getPicture().then(function(imageURI) {
      console.log(imageURI);
      $rootScope.lastPhoto = imageURI;
      $scope.lastPhoto = imageURI;
      $scope.photoTaken = true;
    }, function(err) {
      console.err(err);
    }, {
      quality: 75,
      targetWidth: 320,
      targetHeight: 320,
      saveToPhotoAlbum: false
    });
  }

  $scope.processPhoto = function() {
    // redirect first
    $state.go('preview');

    var img = new Image(),
      canvas = document.createElement("canvas"),
      left = $scope.cropLeft,
      top =  $scope.cropTop,
      width = $scope.cropWidth,
      height = $scope.cropHeight;

    img.onload = function () {
      canvas.width = img.width;
      canvas.height = img.height;

      var ctx = canvas.getContext("2d");
      ctx.drawImage(this, 0, 0);
      var dataUrl = canvas.toDataURL("image/png");

      $http({
        url: env.apiEndpoint + "/contour",
        headers: {'Content-Type': 'application/json'},
        method: 'POST',
        data: {
          'image' : "data:image/png;base64,"
        }
      })
      .then(function(resp) {
        // success
        if(resp.status == 'ok') {
          $rootScope.uuid = resp.uuid;
          $rootScope.$broadcast('event:incoming:data', { status: 'ok', x: resp.payload.x, y: resp.payload.y });
      } else {
          $rootScope.$broadcast('event:incoming:data', { status: 'error', msg: resp.msg });
        }

      }, function(resp) {
        // error
        $rootScope.$broadcast('event:incoming:data', { status: 'error', msg: resp.status + ", " + resp.statusText });
      });
    }

    img.src = "img/oven.png";
  }
})

.controller('PreviewCtrl', function($scope, $rootScope, $state) {
  $scope.data = {
    'points': [{'x': 1, 'y': 1}, {'x': 2, 'y': 1}, {'x': 1, 'y': 2}],
    'width': 1,
    'height': 1,
    'offsetX': 1,
    'offsetY': 1
  };

  $scope.$on('event:incoming:data', function(event, data) {
    var process = function(x, y) {
      if(x.length != y.length) {
        return null;
      } else {
        return x.map(function(e, i) {
          return {'x': e, 'y': y[i]}
        })
      }
    }
    console.log(data);
  })
})
